script: |
  super -f text -I q1986.spq | sort > q1986.out

inputs:
  - name: q1986.spq
    data: |
      SELECT DISTINCT col2 * + col0 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT - col1 * col0 * col1 IN ( col0 * - col2 );
  - name: tab2

outputs:
  - name: q1986.out
    data: |
      189
      2028
      3002
